import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
export default  makeStyles({
    mainBtn:{
      width:'300px',
      marginTop:'12px'
    },
        root: {
          flexGrow: 1,
        },
        title: {
          flexGrow: 1,
        },
        paper: {

            textAlign: 'center',
            color: "red",
          },
          formControl: {

            minWidth: 120,
          }, iconButtonAvatar: {
            padding: 4,
          },button: {
            flexGrow: 1,
          },formControl: {

            minWidth: 120,
          }, searchIcon: {
            padding: theme.spacing(0, 2),
            height: '100%',
            position: 'absolute',
            pointerEvents: 'none',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
          },
          inputRoot: {
            color: 'inherit',
          },
          inputInput: {
            padding: theme.spacing(1, 1, 1, 0),
            // vertical padding + font size from searchIcon
            paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
            transition: theme.transitions.create('width'),
            width: '100%',
            [theme.breakpoints.up('md')]: {
              width: '20ch',
            },
          },

  });
